import React from "react";
import LoginPage from "./components/pages/LoginPage";
import { BrowserRouter, Route } from "react-router-dom";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <BrowserRouter>

       <Route path="/" Component={LoginPage}>
            <LoginPage/>
        </Route>
      </BrowserRouter>
    );
  }
}

export default App;
